;; **
;;; Fit the data for first nonconceptive progesterone curve. Return value of lpk-smoother method is a function.
;; **

;; @@
(def first-nonconceptive (i/to-list (i/$ [:x :y] (i/$where {:subj 1.0} nonconceptive))))
(def fit-low-h (lpk/smooth-function first-nonconceptive :degree 2 :bandwidth 0.32))
(def fit-good-h (lpk/smooth-function first-nonconceptive :degree 2 :bandwidth 1.3))
(def fit-high-h (lpk/smooth-function first-nonconceptive :degree 2 :bandwidth 5.22))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fanova.chapter02.lpksmoother/fit-high-h</span>","value":"#'fanova.chapter02.lpksmoother/fit-high-h"}
;; <=

;; @@
(def points (plot/list-plot first-nonconceptive :plot-size 800 :color "#3E747C"))
(def plot-low-h (plot/plot fit-low-h [-8 15.2] :color "#65BCC9"))
(def plot-good-h (plot/plot fit-good-h [-8 15.2] :color "#7D5C3E"))
(def plot-high-h (plot/plot fit-high-h [-8 15.2] :color "#C98365"))
(plot/compose points plot-low-h plot-good-h plot-high-h)
