;; **

;; @@
(def h (lpk/generate-bandwidths first-nonconceptive (count first-nonconceptive)))
(def gcv (map #(lpk/gcv first-nonconceptive % :degree 2) h))
(plot/list-plot (map vector (m/log10 h) gcv) :joined true)
