(def twentieth-nonconceptive (i/to-list (i/$ [:x :y] (i/$where {:subj 20.0} nonconceptive))))
(def fit-outliers (lpk/smooth-function twentieth-nonconceptive :degree 2))
(def fit-iter1 (lpk/smooth-function data-iter1 :degree 2 :bandwidth bandwidth))
(def fit-iter2 (lpk/smooth-function data-iter2 :degree 2 :bandwidth bandwidth))
(def fit-iter3 (lpk/smooth-function data-iter3 :degree 2 :bandwidth bandwidth))
