;; **
;;; Figure 2.3 Fitting the twentieth nonconceptive progesterone curve by the robust LPK method.
;; **

;; **
;;; ## Reconstructing a set of curves
;; **

;; **
;;; Everything remains the same as individual curve with the exception of bandwidth selection. It is reasonable to use the same kernel and bandwidth for all curves because they usualy exhibit similar smoothness properties and even similar shape.
;; **

;; @@
(def nonconceptive-obs (map #(i/to-list (i/$ [:x :y] %)) (vals (i/$group-by :subj nonconceptive))))
(def conceptive-obs (map #(i/to-list (i/$ [:x :y] %)) (vals (i/$group-by :subj conceptive))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fanova.chapter02.lpksmoother/conceptive-obs</span>","value":"#'fanova.chapter02.lpksmoother/conceptive-obs"}
;; <=

;; @@
(def bandwidths (logspace (m/log10 1) (m/log10 3) 15))
(defn mean-gcv [h] 
  (s/mean (map #(lpk/gcv % h) nonconceptive-obs)))
(def gcv (map #(mean-gcv %) bandwidths))
(plot/list-plot (map vector (m/log10 bandwidths) gcv) :joined true)
