(defn non-subj-data [subj] (i/to-list (i/$ [:x :y] (i/$where {:subj subj} nonconceptive))))
(def plotter33 (fn [data] (plot/compose (plot/list-plot data :plot-size 350) 
                                        (plot/plot (lpk/lpk-smoother data :bandwidth all-bandwidth) [-8 15]))))
(table/table-view [[(table/table-view [[(plotter33 (non-subj-data 1.0)) (plotter33 (non-subj-data 5.0))]]
               	   :columns ["Noncon. Prog. Curve 1" "Noncon. Prog. Curve 5"])]
                   [(table/table-view [[(plotter33 (non-subj-data 10.0)) (plotter33 (non-subj-data 20.0))]]
               	   :columns ["Noncon. Prog. Curve 10" "Noncon. Prog. Curve 20"])]])
