;;; Figure 3.3 Four reconstructed nonconceptive progesterone curves (solid) with the as- sociated data (circles). The effects of the outliers in the two lower panels are spotted.
;;; 
;;; Outliers can be suspected in the plots of subj. 10 and sub 20. We will adjust data for outliers using robust LPK smoother.
;; **

;; @@
(def plotter33 (fn [data] (plot/compose (plot/list-plot data :plot-size 350) 
                                        (plot/plot (lpk/robust-lpk-smoother data :bandwidth 1.87) [-8 15]))))
